import React from 'react';
import { Button, Card, Form } from 'react-bootstrap';

const Signup = () => {
    return (
        <>
            <Card>
                <Card.Body>
                    <h2 className="text-center mb-4">Sign Up</h2>
                </Card.Body>
            </Card>
            <div className="w-100 text-center mt-2">
                Already have an account? Log In
            </div>
        </>
    );
};

export default Signup;
